import React, { useState } from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="nav">

      <ul>
        <li><Link to="/">Home</Link></li>
        <li > <Link to="/login">Login</Link></li>

      </ul>
    </div>
  );
};

export default NavBar;
